export class NoopTranslator {
    constructor() {
        this.url = '{}';
    }
    getCurrentUrl() {
        return this.url;
    }
    getConfig() {
        return {};
    }
    serialize(state) {
        return JSON.stringify(state);
    }
    deserialize(url) {
        return JSON.parse(url);
    }
    go(url) {
        this.url = url;
    }
}
